CREATE DATABASE SkyRoutesDB;
USE SkyRoutesDB;



CREATE TABLE AirlineRoutesData (
    FlightID VARCHAR(20),
    RouteCode VARCHAR(20),
    Origin VARCHAR(10),
    Destination VARCHAR(10),
    FlightDate DATE,
    FlightDurationMins INT,
    AircraftType VARCHAR(20),
    SeatsAvailable INT,
    SeatsSold INT,
    Revenue INT,
    OperationalCost INT
);




SELECT 
    RouteCode,
    COUNT(FlightID) AS TotalFlights
FROM AirlineRoutesData
GROUP BY RouteCode
ORDER BY TotalFlights DESC
LIMIT 10;

SELECT
    RouteCode,
    ROUND(AVG(Revenue), 2) AS AvgRevenue,
    ROUND(AVG(OperationalCost), 2) AS AvgCost,
    ROUND(AVG(Revenue - OperationalCost), 2) AS AvgProfit
FROM AirlineRoutesData
GROUP BY RouteCode;

SELECT
    RouteCode,
    ROUND(AVG(Revenue - OperationalCost), 2) AS AvgProfit
FROM AirlineRoutesData
GROUP BY RouteCode
HAVING AVG(Revenue - OperationalCost) < 0
ORDER BY AvgProfit;


SELECT
    RouteCode,
    ROUND(
        (SUM(SeatsSold) * 100.0) / SUM(SeatsAvailable),
        2
    ) AS SeatOccupancyPercent
FROM AirlineRoutesData
GROUP BY RouteCode
ORDER BY SeatOccupancyPercent DESC;

SELECT
    RouteCode,
    EXTRACT(YEAR FROM FlightDate) AS Year,
    EXTRACT(MONTH FROM FlightDate) AS Month,
    ROUND(SUM(Revenue - OperationalCost), 2) AS MonthlyProfit
FROM AirlineRoutesData
GROUP BY RouteCode, Year, Month
ORDER BY RouteCode, Year, Month;


SELECT
    CASE
        WHEN LEFT(Origin, 2) = LEFT(Destination, 2) THEN 'Domestic'
        ELSE 'International'
    END AS RouteType,
    ROUND(SUM(Revenue - OperationalCost), 2) AS TotalProfit,
    ROUND(AVG(Revenue - OperationalCost), 2) AS AvgProfit
FROM AirlineRoutesData
GROUP BY RouteType;


SELECT
    RouteCode,
    ROUND(
        SUM(Revenue) / SUM(FlightDurationMins),
        2
    ) AS RevenuePerMinute,
    RANK() OVER (
        ORDER BY SUM(Revenue) / SUM(FlightDurationMins) DESC
    ) AS RouteRank
FROM AirlineRoutesData
GROUP BY RouteCode;
